import React, { Component } from 'react';

class PlaylistPicker extends Component {
    constructor(props) {
        super(props);
        this.state = {
            timeToGuess: 10
        }
    }

    render() {
        return (
            <div>
                <p>Select a playlist from the list</p>
            </div>
        );
    }
}

export default PlaylistPicker;
